import React from "react";
import { Route, Redirect } from "react-router-dom";
const PrivateRoute = ({ component: Component, isAuthenticated }) => (
  <Route
    render={(props) =>
      isAuthenticated ? <Component /> : <Redirect to="/login" />
    }
  />
);
export default PrivateRoute;
